import React, { Component } from 'react';
import './App.css';
import VenueName from './VenueName.js'
import Section from './Section.js'

class App extends Component {
  render() {
    return (
      <div className="App">

        <VenueName
          name = "Kitty+Burn"
        />

        <Section
          name = "All Day Menu"
        />

      </div>
    );
  }
}

export default App;
